import { useContext } from 'react';
import MovieContext from './context/MovieContext';
import styled from 'styled-components';
import Navbar from 'react-bootstrap/Navbar';
import { FaPhone } from 'react-icons/fa';
import { MdEmail, MdMap } from 'react-icons/md';
import Link from './Link';

const Styled = styled.header`
  /* position: ${props => (props.navScroll ? 'fixed' : 'absolute')}; */
  padding: 0.5em 0;
  top: 0;
  left: 0;
  right: 0;
  z-index: 1000;
  background-color: ${props =>
    props.navScroll ? 'var(--second-clr)' : 'none'};
  animation: 1s fadeIn linear;


  /* nav links */
  .nav--link {
    &__item {
      font-weight: var(--fw-bold);
      color: var(--second-clr);
      font-size: 1.1rem;
      transition: var(--ease--in--out--02s);
      cursor: pointer;

      &:hover,
      &:focus {
        color: var(--primary-clr);
      }
    }
  }

  /* Change Nav Links Active */
  .selected {
    color: var(--primary-clr) !important;
  }

  /* Top head */
  .head--top {
    display: ${props => (props.navScroll ? 'none' : 'flex')};
    justify-content: space-between;
    flex-wrap: wrap;
    align-items: center;
    padding: 0 0.5em;

    .info--link {
      color: var(--white-clr);
      display: flex;
      justify-content: space-evenly;
      align-items: baseline;
      font-size: 0.85rem;
      cursor: pointer;
      transition: var(--ease--in--out--02s);
      margin-bottom: 0.5em;

      &:hover,
      &:focus {
        color: var(--primary-clr);
      }
      svg {
        margin-right: 0.5em;
        color: var(--primary-clr);
      }
    }
  }

  .brand-logo--top {
    display: none;
  }

  /* NavBar */
  .navbar {
    display: flex;
    justify-content: space-between;
    align-items: center;
    margin-top: ${props => (props.navScroll ? '0' : '1em')};
    padding: ${props => (props.navScroll ? '.5em' : '0')};
  }

  .brand-logo {
    display: block;
    width: 120px;
  }

  .nav--toggle {
    transition: var(--tran--opa);
    opacity: ${props => (props.toggle ? '0' : 1)};
    margin-right: 1em;
  }

  .burger,
  .burger::before,
  .burger::after {
    background-color: ${props =>
      props.toggle ? 'var(--second-clr)' : 'var(--white-clr)'};
    width: 1.5em;
    height: 3px;
    transition: var(--tran--opa);
  }

  .burger {
    display: block;
    position: relative;
    transform: ${props => (props.toggle ? 'rotate(45deg)' : '')};

    &:hover,
    &:focus,
    &:hover::before,
    &:focus::before,
    &:hover::after,
    &:focus::after {
      background-color: var(--second-clr);
    }

    &::after,
    &::before {
      content: '';
      position: absolute;
      left: 0;
    }

    &::before {
      bottom: 6px;
      opacity: ${props => (props.toggle ? '0' : '1')};
    }
    &::after {
      top: 6px;
      transform: ${props =>
        props.toggle ? 'rotate(90deg) translate(-6px)' : ''};
    }
  }

  .inside-nav {
    opacity: 1;
    margin-right: 0;
  }

  .info--nav {
    display: none;
  }
  /* navbar--group */
  .navbar--group {
    z-index: 10;
    transition: var(--tran--opa);
    position: fixed;
    top: 0;
    right: 0;
    background-color: var(--white-clr);
    height: 100vh;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: space-evenly;
    width: 70vw;
    transform: ${props =>
      props.toggle ? 'translateX(0)' : 'translateX(105%)'};
  }

  @media screen and (min-width: 1200px) {
    /* position: ${props => (props.navScroll ? 'fixed' : 'absolute')}; */
    margin-top: ${props => (props.navScroll ? '0' : '1em')};
    /* max-width: ; */
    margin: 0 auto;
    padding: 0 1em;

    .brand-logo {
      width: 150px;
    }

    .nav--toggle {
      display: none;
    }

    .info--link + .info--link {
      margin-left: 2em;
    }

    /* Top head */
    .head--top {
      position: relative;
      justify-content: end;
      padding: 0;
      max-width: 1600px;
      margin: 0 auto 1em;

      & > :last-child {
        margin-left: auto;
      }
    }

    .navbar {
      padding: ${props => props.navScroll && '.5em'};
      max-width: 1600px;
      margin: 0 auto;
      align-items: flex-end;
    }

    /* Navbar */
    .navbar--group {
      z-index: 10;
      transition: var(--tran--opa);
      position: relative;
      top: 0;
      right: 0;
      background-color: transparent;
      height: auto;
      display: flex;
      flex-direction: row;
      align-items: center;
      justify-content: space-between;
      transform: translateX(0);
      max-width: 70%;
      margin-left: auto;
    }

    .nav--link {
      &__item {
        color: var(--white-clr);
        &:hover,
        &:focus {
          color: var(--primary-clr);
        }
      }
    }
  }
`;

const Nav = () => {
  const { toggle, setToggle, navScroll, navRef } = useContext(MovieContext);

  return (
    <Styled
      className='header'
      ref={navRef}
      toggle={toggle}
      navScroll={navScroll}
    >
      <Navbar collapseOnSelect expand='lg' bg='dark' variant='dark'>
        <Navbar.Brand href='#home'>React-Bootstrap</Navbar.Brand>
        <Navbar.Toggle aria-controls='responsive-navbar-nav' />
        <Navbar.Collapse id='responsive-navbar-nav'>
          <Nav className='mr-auto'>
            <Nav.Link href='#features'>Features</Nav.Link>
            <Nav.Link href='#pricing'>Pricing</Nav.Link>
            <NavDropdown title='Dropdown' id='collasible-nav-dropdown'>
              <NavDropdown.Item href='#action/3.1'>Action</NavDropdown.Item>
              <NavDropdown.Item href='#action/3.2'>
                Another action
              </NavDropdown.Item>
              <NavDropdown.Item href='#action/3.3'>Something</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href='#action/3.4'>
                Separated link
              </NavDropdown.Item>
            </NavDropdown>
          </Nav>
          <Nav>
            <Nav.Link href='#deets'>More deets</Nav.Link>
            <Nav.Link eventKey={2} href='#memes'>
              Dank memes
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </Styled>
  );
};

export default Nav;

